//TINY MCE PLUGIN
tinymce.PluginManager.add('slick_code', function(editor, url) {

    editor.ui.registry.addButton('slick_code', {
        icon: 'sourcecode',
        tooltip: 'Code',
        onAction: (e) => {
            toggleCode(e, editor);
        }
    });

    //LISTEN FOR EDITOR CHANGE
    $('#'+editor.id).on('change', function(){ editor.setContent($(this).val()); });

    //DEFINE THE TOGGLE CODE
    var toggleCode = function(elem, editor){
        var elemBtn         = $(editor.editorContainer).find('button[data-mce-name="slick_code"]');
        var tinyContainer   = $(editor.editorContainer);
        var aceID           = 'ace-editor-'+editor.id;
        var defaultLineHeightRatio = 0.85;
        var defaultLineHeight = 16;
        
        //CHECK IF ACE IS NOT DEFINED
        if(typeof ace !== 'undefined'){

            //HIDE THE TINY MCE CONTAINER
            tinyContainer.hide();

            //HIDE THE TEXTAREA
            var textarea = $('#'+editor.id).hide();

            //DEFINE THE TOGGLE BUTTON WRAPPER 
            var visualEditorToggleBtnWrap = $('<div class="text-end visual-editor-toggle-btn-wrap" style="margin-top:-40px;"></div>');

            //ADD THE TOGGLE BUTTON WRAPPER
            $('#'+editor.id).after($(visualEditorToggleBtnWrap));

            //DEFINE THE ACE CONTENT WRAPPER
            $(visualEditorToggleBtnWrap).after('<div style="border:1px solid #d8d8d8; border-radius:5px;" id="'+aceID+'"></div>');

            //LAD THE EDITOR AND BEAUTIFIER
            var beautify        = ace.require("ace/ext/beautify");
            var aceEditor       = ace.edit(aceID);

            //ADD THE VISUAL EDITOR BUTTON
            $(visualEditorToggleBtnWrap).append($('<a href="#" title="Switch to Visual Editor" class="btn btn-light"><i class="fas fa-glasses"></i></a>').click(function(e){
                e.preventDefault();
                $(tinyContainer).show();
                aceEditor.destroy();
                $('#'+aceID).remove();
                $(this).parent().remove();
            }));

            //ADD FULL SCREEN TOGGLE BUTTON
            $(visualEditorToggleBtnWrap).append($('<a class="btn btn-light" title="Full Screen" href="#"><i class="fas fa-window-restore"></i></a>').click(function(e){
                e.preventDefault();

                //CHECK IF NEEDSS TO CLOSE
                if($(this).hasClass('toggled-full-screen-open')){
                    $(this).html('<i class="fas fa-window-restore"></i>').attr('title', 'Full Screen').toggleClass('btn-light', 'btn-dark').toggleClass('text-light', 'text-dark');
                    $(this).removeClass('toggled-full-screen-open');
                    $(aceEditor.container).removeClass('toggled-full-screen-open-container');
                    $(this).blur();
                    $(window).resize();
                }

                //NEEDS TO OPEN
                else{
                    $(this).addClass('toggled-full-screen-open');
                    $(this).html('<i class="far fa-window-close"></i>').attr('title', 'Exit Full Screen').toggleClass('btn-light', 'btn-dark').toggleClass('text-light', 'text-dark');
                    $(this).blur();
                    $(aceEditor.container).addClass('toggled-full-screen-open-container');
                    $(window).resize();
                }
            }));

            //SET THE RATIO FOR HOW MUCH SCREEN TO FILL
            var scaleLineHeightOffsetRatio = defaultLineHeightRatio;

            //LISTEN FOR WINDOW RESIZE
            $(window).resize(function(){
                
                //PARSE THE LINE HEIGHT
                scaleLineHeightOffsetRatio = $(aceEditor.container).hasClass('toggled-full-screen-open-container') ? 1 : defaultLineHeightRatio;
                try{ var lineHeight = $(aceEditor.container).find('.ace_scroller').css('line-height').replace('px', ''); }
                catch{ var lineHeight = defaultLineHeight; }                
                if(Number(lineHeight) <= 0) lineHeight = defaultLineHeight;

                //SET THE NEW LINE COUNT
                aceEditor.setOptions({
                    minLines            : (Math.round((($(window).height() / lineHeight)) * scaleLineHeightOffsetRatio))+2,
                    maxLines            : (Math.round((($(window).height() / lineHeight)) * scaleLineHeightOffsetRatio))+2,
                });

                //RESIZE THE EDITOR
                aceEditor.resize();
            });

            //SETUP THE ACE EDITOR       
            aceEditor.setTheme("ace/theme/monokai"); //IF YOUR IDE DOESNT USE A MONOKAI SKIN THEN I FEEL BAD FOR YOUR EYES
            aceEditor.setValue(textarea.val(), 1);

            //SETUP THE ACE EDITOR SESSION
            aceEditor.session.setUseWorker(false)
            aceEditor.session.setMode("ace/mode/html");

            //PARSE THE LINE HEIGHT
            try{var lineHeight = $(aceEditor.container).find('.ace_scroller').css('line-height').replace('px', ''); }
            catch{var lineHeight = defaultLineHeight;}
            if(Number(lineHeight) <= 0) lineHeight = defaultLineHeight;

            //SETUP THE DEFAULT OPTIONS
            aceEditor.setOptions({
                wrap                : false,
                displayIndentGuides : true,
                highlightActiveLine : true,
                showPrintMargin     : false,
                enableBasicAutocompletion: true,
                enableLiveAutocompletion: true,
                minLines            : (Math.round((($(window).height() / lineHeight)) * scaleLineHeightOffsetRatio))+2,
                maxLines            : (Math.round((($(window).height() / lineHeight)) * scaleLineHeightOffsetRatio))+2,
            });

            //BEAUTIFY THE CONTENT
            beautify.beautify(aceEditor.session);

            var provider = LanguageProvider.fromCdn("https://www.unpkg.com/ace-linters@latest/build/");
            provider.registerEditor(aceEditor);

            //LISTEN FOR CHANGE
            aceEditor.on('change', function () {
                textarea.val(aceEditor.getValue()).trigger('keyup');
                editor.setContent(aceEditor.getValue());
            });
        }
        else {

            //MAYBE RENDER FALLBACK TO TEXTAREA HERE 

        }
    };
});
